import React from 'react'
import './mobile.css'

function Mobile() {
    return (
        <div>
            Mobile
            <div>Icons made by <a href="https://www.flaticon.com/authors/phoenix-group" 
            title="Phoenix Group">Phoenix Group</a> from <a href="https://www.flaticon.com/" 
            title="Flaticon">www.flaticon.com</a></div>
        </div>
    )
}

export default Mobile
